import React , {Component} from 'react'
import {Link} from 'react-router-dom'
class RegistroUser extends Component{
    render(){
        return(
            <div className="form-group">
                <label>Nombre</label>
                        <input className="form-control" 
                        type="text" 
                        name="firstName" />
            </div>
        )
    }
}
export default RegistroUser;
